                        <p>Privacy</p>
                        <p>Terms & conditions</p>
                        <p>Security</p>
                    </div>
                    
                    <div>
                    <h4 style={{ color: "antiquewhite", fontSize: "18px" }}> Â© 2020 Copyright :<span class="developer">Eduamto</span></h4>
                    </div>
                </div>
            </div>   
        </div>
    )
}

export default Footer;
